import React from 'react'
import "./profile.css";
function Profile() {
    return (
        <div>
        <div className={`lognavss`}>
            <img src="https://download.logo.wine/logo/Netflix/Netflix-Logo.wine.png" alt="" id="netflixlogos"/>
            <img src="https://ih0.redbubble.net/image.618427277.3222/flat,1000x1000,075,f.u2.jpg" alt="" id="imgs"/>
        </div>
        </div>
    )
}

export default Profile
